class Validator:
    def __init__(self, username):
        self.username = username

    def validate_fabs_files(self, files):
        print(f"Validating FABS files for validator: {self.username}")
        # Implement logic to validate FABS files
        valid_files = []
        for file in files:
            # Check file format and content
            if file.endswith(".csv") and self.check_file_content(file):
                valid_files.append(file)
        return valid_files

    def check_file_content(self, file_name):
        # Implement logic to check file content
        # For example, check if the file has the required columns
        required_columns = ["column1", "column2", "column3"]
        file_columns = self.get_file_columns(file_name)
        return all(column in file_columns for column in required_columns)

    def get_file_columns(self, file_name):
        # Implement logic to get file columns
        # For example, read the first row of the CSV file
        import csv
        with open(file_name, 'r') as file:
            reader = csv.reader(file)
            return next(reader)


